import { useEffect } from 'react';
import RouterApp from '../router/Router';

function App() {
    useEffect(() => {
        window.addEventListener('onbeforeunload', () => {
            localStorage.removeItem('token');
        });
    });
    return (
        <>
            <RouterApp />
        </>
    );
}

export default App;
